INSERT INTO `news` (`news_id`, `title`, `article`, `picture`, `source`, `date_added`) VALUES
(4, 'Why a Mach 5 passenger plane is a crazy idea that might just work', '(CNN) â€” Almost two decades since Concorde retired, interest around supersonic travel has been picking up pace, and several super-fast planes are under development. Airlines seem interested: United has already committed itself to offering supersonic routes as early as 2029. But what about hypersonic travel, which happens at speeds of Mach 5 -- five times the speed of sound -- and above? That would get an aircraft from New York to London in just 90 minutes, compared to about three hours for Concorde, and between six to seven hours for a regular passenger jet.\n\n', , '3', '2021-11-17 19:13:34');
